DELIMITER $$
DROP PROCEDURE IF EXISTS AddColumn $$
CREATE PROCEDURE AddColumn()
BEGIN
    IF NOT EXISTS((SELECT * FROM information_schema.COLUMNS WHERE TABLE_SCHEMA=DATABASE() AND COLUMN_NAME='Patch' AND TABLE_NAME='creature_template')) THEN
        ALTER TABLE `creature_template`
            ADD COLUMN `Patch` INT UNSIGNED NOT NULL DEFAULT '0' AFTER `difficulty_entry_3`,
            DROP PRIMARY KEY,
            ADD PRIMARY KEY (`entry`, `Patch`) USING BTREE;
    END IF;
END $$
CALL AddColumn()
$$
